subSubSection.paragraph:
Description of 
holotype

. A mature male of medium size (SVL = 
40.5 mm
, TrL = 
19.5 mm
). Head relatively long (HL/SVL = 0.24) and wide (HW/HL = 0.88), distinct from neck. Loreal region slightly inflated; no distinct canthus rostralis. Top of snout, area between nares, and area posterior to nares concave. Snout tapered and rounded at tip, relatively long (SN/HL = 0.44), almost twice eye diameter (SN/EY = 1.9). Eye relatively small (EY/HL = 0.23, EY/ EN = 0.65); pupil vertical, constricted into series of four lobes; supraciliaries slightly larger than adjacent granules. Ear opening small (Ear/HL = 0.073), compressed, oriented diagonally from posterodorsal to anteroventral on right, horizontal on left; distance between ear and eye significantly larger than eye diameter (EE/EY = 1.6). Rostral wider (2.0 mm) than high (
0.9 mm
), highest just medial to nares, lower between these points; length (
0.2 mm
); barely visible from above. Supranasals separated by three internasals. Rostral in contact with first supralabials, two supranasals, and three internasals. External nares circular; each bordered by rostral, two supranasals, first supralabial, and one postnasal. Mental shallowly triangular, shorter (
0.60 mm
) than wide (
0.75 mm
). Mental bordered posteriorly by two enlarged postmentals, these bordered posteriorly by three rows of enlarged gulars that are followed by smaller granular chin scales. First three infralabials bordered below by somewhat enlarged postmentals; remaining scales below infralabials smaller, only twice size of central throat scales. Supralabials to mid-orbital position nine on each side; to angle of jaw 12 on each side. Infralabials 13 on each side.
